import Link from "next/link";

const Navbar = () => {
	return (
		<div>
			<nav>
				<Link href="/">
					<a>Home</a>
				</Link>
				<Link href="/about">
					<a>About</a>
				</Link>
			</nav>
			<style jsx>{`
				nav {
					display: flex;
					flex-direction: row;
					width: 100%;
					justify-content: flex-start;
					align-items: center;
					height: 3rem;
					background-color: red;
				}
				a {
					margin: 0 2rem;
					text-decoration: none;
					color: #fff;
				}
			`}</style>
		</div>
	);
};

export default Navbar;
